{"operationName":"blocks","variables":{"timestampFrom":1673811300,"timestampTo":1673811900},"query":"query blocks($timestampFrom: Int!, $timestampTo: Int!) {
  blocks(
    first: 1
    orderBy: timestamp
    orderDirection: asc
    where: {timestamp_gt: $timestampFrom, timestamp_lt: $timestampTo}
  ) {
    id
    number
    timestamp
  }
}
"}

